//parametric Standart<br />
n=3;       //number of wings - nombre d'ailette<br />
L=50;      //lenght top to bottom - longueur de la pointe a la base<br />
l=20;      //largeur d'une ailette<br />
E=3 ;      //thickness wings - epaisseur a la base de l'aillette<br />
D=4;      //interne tube diametre - diametre du tube interieur ferule  
//Hole<br />
hole=&quot;yes&quot;; //&quot;yes&quot; or &quot;no&quot; hole<br />
d=6.66;     //Hole Diametre  
// arrowbility!!<br />
A=10;        //arrawbility !! 0 for noob printer !, negative for the furious !  
$fa=2;<br />
$fs=0.01;  
//1 aile<br />
module aile(){  
<code >if(hole=="yes"){  
    difference(){  
        polyhedron(  
            points=[[0,0,0],[l,0,L],[0,-E/2,L-A],[0,E/2,L-A]],  
            faces=[[2,1,0],[3,2,0],[3,0,1],[1,2,3]]  
            );    
        translate([l/2.33,E,L/1.33]) rotate([90,0,0])cylinder(r=d/2,h=2*E);  
    }  
}  
else{  
    polyhedron(  
            points=[[0,0,0],[l,0,L],[0,-E/2,L-A],[0,E/2,L-A]],  
            faces=[[2,1,0],[3,2,0],[3,0,1],[1,2,3]]  
            );    
}  </code>
}  
//n aile<br />
module fleche(){<br />
for (i=[1:n]){<br />
rotate([0,0,i*(360/n)])aile();<br />
}<br />
}<br />
//tube centrale<br />
module tube(){<br />
translate([0,0,L/2])cylinder (r=D/2+0.75, h=L/2);<br />
translate([0,0,L/5])cylinder(d1=0,r2=D/2+0.75,h=L/2-L/5);<br />
}  
// module principal<br />
translate([0,0,L]) rotate([180,0,0])<br />
difference(){<br />
union(){<br />
fleche();<br />
tube();<br />
}<br />
translate([0,0,L/2+3]) cylinder (r=D/2, h=L);<br />
}
